import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { HashRouter as Router } from 'react-router-dom';
import 'core-js/modules/es7.array.includes';
import 'core-js/modules/es6.array.fill';
import 'core-js/modules/es6.string.includes';
import 'core-js/modules/es6.string.trim';
import 'core-js/modules/es7.object.values';
import AssistantManager from './AssistantManager';
import { createStore } from 'redux'
import { Provider } from 'react-redux'

const initialState = {
    assistants: [],
    assistantsLoaded: false,
    selectedAssistant: "",
    stats: {}
}

function reducer(state=initialState, action) {
    console.log(JSON.stringify(action))
    switch(action.type) {
        case "ASSISTANTS_LOADED":
             return Object.assign(state, {
                assistants: action.assistants,
                assistantsLoaded: true,
                selectedAssistant: action.assistants[0]
            });
        case "STATS_LOADED":
            return { state, stats: action.stats }
        case "ASSISTANT_SELECTED":
            return { state, selectedAssistant: action.assistant }
        default:
            return state
    }
}

let store = createStore(reducer)

let assistantManager = new AssistantManager(store)
assistantManager.loadAssistants()

ReactDOM.render(<Router><Provider store={store}><App/></Provider></Router>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
